import React from "react";

class ParkInfo extends React.Component {
  render() {
    return (
      <div>

      {this.props.name && <p>Park Name: {this.props.name}</p>}

      {this.props.fullName && <p>Full Name:{this.props.fullName}</p>}

      <p>State: {this.props.states}</p>}

      <p>Designation:{this.props.designation}</p>}

      <p>Weather: {this.props.weatherInfo}</p>}

      <p>Coordinates: {this.props.latLong}</p>}

      <p>Description: {this.props.description}</p>}
      </div>
    );
  }
}

export default ParkInfo;
